収納空間の消臭力 クローゼット・ロッカー用 シルクソープ 本体 32g<br>ブランド：消臭力<br>販売・製造元：エステー<br><br>クローゼット等のパイプにかけるだけの衣類用消臭剤です。<br>収納空間のこもったニオイや衣類についたニオイを取り込んで消臭するゼリーの効果で収納空間・衣類をさわやかにします。<br>清潔感のあるシルクソープの香り。<br>衣類にほのかな香りが残ります。<br>防虫剤と一緒に使用できます。<br> <br>用途衣類の収納空間用 <br><br>使用方法<br>使用の目安：約2400L(180*60*220cm)までのクローゼット・洋服ダンス・ロッカーに1個使用期間：約2-3ヶ月(季節や仕様状況により異なります)(1)外容器を開き、薬剤トレーを取りだす。<br>(2)薬剤トレーのアルミシールのみをゆっくりはがす。<br>(白いシートははがさない)(3)薬剤トレーの白いシート側を外容器背面に合わせて元通りセットします。<br>(4)パイプなどにかけて使用します。<br>薬剤が見えなくなったら、お取り替えください。<br>※ 白いシートに薬剤が付着していますので、さわらずにそのまま容器にセットしてください。<br> <br><br>使用上の注意<br>●本品は食べられない。<br>●薬剤が目に入ったり手についた場合は水で充分に洗い流す。<br>●万一、まちがって食べた場合は医師に相談する。<br>●幼児の手の届くところに置かない。<br>●万一、薬剤が付着した場合はすぐに拭き取る。<br>塗装面やプラスチックなどを傷める場合がある。<br>●ウレタンコーティング・塩化ビニールコーティング品(バッグや合成皮革のジャケット等)は薬剤により変質することがあるので容器と密着して使用しない。<br>●高温になる所や直射日光の当たる所には置かない。<br>●破損する恐れがあるので乱暴に扱わない。<br>●用途以外に使用しない。<br>※ 中身に空間がありますが、内容量は表示の通りです。<br>※ 使用期間中はケースを保管してください。<br>※ 衣類に残った香りが気になる場合は風通しの良いところで陰干ししてください。<br> <br>成分<br>消臭剤、香料、パラフィン系揮散調整剤、ゲル化剤<br> 原産国日本 <br><br>お問い合わせ先<br>エステー株式会社 お客様相談室：03-3367-2120 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。<br>屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。<br>消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。<br><br>日用品／家庭用品／消臭・芳香剤／消臭剤 衣類用<br>JANコード： 4901070121359<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
